import { createPublicClient, http } from "viem";
import { createConfig, mainnet, WagmiConfig } from "wagmi";

const config = createConfig({
  autoConnect: true,
  publicClient: createPublicClient({
    chain: mainnet,
    transport: http(),
  }),
});

function App() {
  return (
    <WagmiConfig config={config}>
      <div></div>
    </WagmiConfig>
  );
}

export default App;
